template<typename T>
void generateRandomIntegers(std::vector<T>& randomArray, size_t n) {
    for (size_t i = 0; i < n; i++) {
        int magnitude = std::rand();
        bool negative = (std::rand() & 0x1) == 0x1;
        if (negative) magnitude = -magnitude;
        randomArray.push_back(magnitude);
    }
}
double clocksToSeconds(clock_t t) {
    return (double)t / CLOCKS_PER_SEC;
}

/// <summary>
/// do one quickSort pass comparing array entries vs target
/// </summary>
/// <typeparam name="T"></typeparam>
/// <param name="arr"></param>
/// <param name="target"></param>
template<typename T>
void quickSortPass( std::vector<T>& arr, const T & target) {
    int n = arr.size();
    size_t left = 0;
    size_t right = n - 1;
    bool done = false;
    while (!done) {
        // move left cursor till array[left] >= target
        while (left<n && left < right && arr[left] <= target) {
            left++;
        }
        // move right cursor till right < target
        while (right>=0 && left < right && arr[right] > target) {
            right--;
        }
        if (left < right) {
            std::swap(arr[left], arr[right]);
        }
        else {
            done = true;
        }
    }
}

/* Function to sort an array using insertion sort*/
template<typename T>
void insertionSort(std::vector<T>& arr ) {
    int n = arr.size();
    for (long unsorted = 1; unsorted < n; unsorted++) {
        T nextItem = arr[unsorted];
        
        long  loc = unsorted - 1;

        /* Move elements of arr[0..unsorted-1], that are
        greater than nextItem, to one position ahead
        of their current position */
        while (loc >= 0 && arr[loc] > nextItem) {
            arr[loc + 1] = arr[loc];
            loc--;
        }
        arr[loc + 1] = nextItem;
    }
}

template<typename T>
void rearrangeN(std::vector<T>& sortMe) {
    T target;
    quickSortPass(sortMe, target= 0);
}

template<typename T>
void rearrangeN2(std::vector<T>& sortMe) {
    insertionSort(sortMe);
}


// A utility function to print an array of size n
template<typename T>
void printArray(std::string message, std::vector<T> & arr) {
    std::cout << message;
    size_t n = arr.size();
    for (size_t i = 0; i < n; i++) {
        std::cout << arr[i] << " ";
    }
    std::cout << std::endl;
}


